  return ( 
    <>
      <BasicPageTitle title="채팅" description="채팅 페이지 작업예정" />  
      <AppLayout title="채팅" requiredLogin={true}>  
        CHAT 
      </AppLayout>
    </>
  ); 
};


export default ChatPage;
